import React, { useState, useEffect } from 'react';

function PatientDashboard({ user }) {
  const [dashboardData, setDashboardData] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchDashboardData = async () => {
      if (!user || !user.username) {
        console.log('User or username is undefined:', user);
        return;
      }

      console.log('Fetching dashboard data for:', user.username);
      try {
        const response = await fetch(
          `http://localhost:5001/api/patients/dashboard?username=${encodeURIComponent(user.username)}`,
          {
            method: 'GET',
            headers: { 'Content-Type': 'application/json' },
          }
        );

        const data = await response.json();
        console.log('Dashboard data:', data);

        if (response.ok) {
          // API ส่ง { data: { ... } } หรือ { ... }? ปรับตามจริง
          setDashboardData(data.data || data);
        } else {
          setError(data.error || 'Failed to fetch dashboard data');
        }
      } catch (err) {
        console.error('Fetch error:', err);
        setError('Network error. Please try again.');
      }
    };

    fetchDashboardData();
  }, [user]);

  if (error) return <p className="text-red-500 mt-4">{error}</p>;
  if (!dashboardData) return <p className="mt-4">Loading dashboard...</p>;

  return (
    <div className="max-w-md mx-auto mt-10 p-6 bg-white rounded shadow">
      <h2 className="text-2xl font-bold mb-4">Patient Dashboard</h2>
      <div className="space-y-2">
        <p><strong>Welcome:</strong> {dashboardData.fullName || dashboardData.username}</p>
        <p><strong>Role:</strong> {dashboardData.role}</p>
        <p><strong>User ID:</strong> {dashboardData.userId}</p>
        <p><strong>Birth Date:</strong> {dashboardData.birthDate ? new Date(dashboardData.birthDate).toLocaleDateString() : 'N/A'}</p>
        <p><strong>Phone:</strong> {dashboardData.phone || 'N/A'}</p>
        <p><strong>Address:</strong> {dashboardData.address || 'N/A'}</p>
        <p><strong>Chronic Disease:</strong> {dashboardData.chronicDisease || 'N/A'}</p>
        <p><strong>Drug Allergy:</strong> {dashboardData.drugAllergy || 'N/A'}</p>
        <p><strong>Food Allergy:</strong> {dashboardData.foodAllergy || 'N/A'}</p>
        <p><strong>Next Appointment:</strong> {dashboardData.appointmentDate ? new Date(dashboardData.appointmentDate).toLocaleString() : 'None'}</p>
        <p><strong>Status:</strong> {dashboardData.status || 'N/A'}</p>
        <p><strong>Staff ID:</strong> {dashboardData.staffId || 'None'}</p>
        <p><strong>Treatment ID:</strong> {dashboardData.treatmentId || 'None'}</p>
      </div>
    </div>
  );
}

export default PatientDashboard;
